class TidesForecast extends HTMLElement {
  constructor() {
    super();
    this.attachShadow({ mode: "open" });
    this.apiKey = "c8e12526-8bb7-4be9-9d2d-dc88a22fc766";
    this.date = new Date().toISOString().split("T")[0]; // Current date in "YYYY-MM-DD" format
    this.latitude = this.getAttribute("latitude");
    this.longitude = this.getAttribute("longitude");
  }

  connectedCallback() {
    // Wait for the shadow DOM to be fully attached
    if (this.shadowRoot) {
      this.fetchTidesData();
    } else {
      // If shadow DOM is not ready, use a MutationObserver to wait for it
      const observer = new MutationObserver(() => {
        if (this.shadowRoot) {
          observer.disconnect();
          this.fetchTidesData();
        }
      });
      observer.observe(this, { childList: true });
    }
  }

  async fetchTidesData() {
    const apiUrl = `https://www.worldtides.info/api/v3?heights&extremes&date=${this.date}&lat=${this.latitude}&lon=${this.longitude}&days=5&key=${this.apiKey}&plot&points&background=228,252,239&timemode=24`;

    return new Promise((resolve) => {
      this.renderData(response.extremes);
      resolve(true);
    });

    // try {
    //   const response = await fetch(apiUrl);
    //   // const data = await response.json();
    //   if (response.extremes) this.renderChart(response.extremes);
    //   else console.error("Unable to fetch forecast data");
    // } catch (error) {
    //   console.error("Error fetching data:", error);
    //   this.renderChart(response.extremes);
    // }
  }
  renderChart(container, extremes) {
    const dataPoints = extremes.map((entry) => {
      const dateTime = new Date(entry.date);
      // Format the date and time (adjust format as needed)
      const formattedDateTime = dateTime.toLocaleString("en-US", {
        day: "numeric",
        hour: "numeric",
        minute: "numeric",
        // month: "short",
      });

      // Construct the label with tide type and formatted date and time
      const label = `${formattedDateTime}`;

      return {
        label: label,
        height: entry.height,
      };
    });

    console.log({ container });

    const labels = dataPoints.map((entry) => entry.label);
    const heights = extremes.map((entry) => entry.height);

    // Create a canvas element for the Chart
    const canvas = document.createElement("canvas");
    canvas.width = 400; // Set the width as needed
    canvas.height = 300; // Set the height as needed
    container.appendChild(canvas);

    const ctx = canvas.getContext("2d");

    new Chart(ctx, {
      type: "line",
      data: {
        labels: labels,
        datasets: [
          {
            label: "Tidal Heights",
            data: heights,
            borderWidth: 0,
            fill: "origin",
          },
        ],
      },
      options: {
        responsive: true,
        maintainAspectRatio: false,
        scales: {
          x: {
            type: "category",
            labels: labels,
            position: "bottom",
            grid: {
              display: true, // Set display to false to hide x-axis grid lines
            },
          },
          y: {
            grid: {
              display: true, // Set display to false to hide x-axis grid lines
            },
          },
        },
        plugins: {
          legend: {
            display: false,
          },
          customCanvasBackgroundColor: {
            color: "lightGreen",
          },
        },
      },
    });
  }

  renderData(extremes) {
    // Select the first 6 tides
    const firstSixTides = extremes.slice(0, 15);

    // Create a container div with Bootstrap grid classes
    const container = document.createElement("div");
    // container.classList.add("container");

    // Create a Bootstrap row
    const row = document.createElement("div");
    row.classList.add("row", "m-0", "p-0");

    // Create a Bootstrap column for the table
    const tableCol = document.createElement("div");
    tableCol.classList.add("col-md-3"); // Medium width: 4 columns
    const tableContainer = document.createElement("div");
    tableContainer.innerHTML = `
        <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha3/dist/css/bootstrap.min.css" rel="stylesheet"
        integrity="sha384-KK94CHFLLe+nY2dmCWGMq91rCGa5gtU4mk92HdvYe+M/SXH301p5ILy+dN9+nJOZ" crossorigin="anonymous">
        <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@300;400;500;700&display=swap" rel="stylesheet" />
          <style>
            canvas {
              width: 100%;
              height: 100%;
            }
          </style>
          <table class="table">
            <thead>
              <tr>
              <th scope="col">Time</th>
                <th scope="col">Tide</th>
              </tr>
            </thead>
            <tbody>
            </tbody>
          </table>
    `;

    const tbody = tableContainer.querySelector("tbody");

    // Populate the table with the first 6 tides
    firstSixTides.forEach((entry, index) => {
      const row = document.createElement("tr");
      row.innerHTML = `
        <td>${this.formatDateTime(entry.date)}</td>
        <td>${entry.type}</td>
      `;
      tbody.appendChild(row);
    });

    tableCol.appendChild(tableContainer);

    // Create a Bootstrap column for the chart
    const chartCol = document.createElement("div");
    chartCol.classList.add("col-md-9"); // Medium width: 8 columns
    const chartContainer = document.createElement("div");
    chartCol.appendChild(chartContainer);
    row.appendChild(chartCol);
    row.appendChild(tableCol);
    container.appendChild(row);
    this.shadowRoot.appendChild(container);
    this.renderChart(chartCol, response.heights);
  }

  formatDateTime(dateTimeString) {
    const dateTime = new Date(dateTimeString);
    // Format the date and time (excluding month, year, and minutes)
    const formattedDateTime = dateTime.toLocaleString("en-US", {
      day: "numeric",
      hour: "numeric",
      minute: "numeric",
      month: "short",
    });
    return formattedDateTime;
  }
}

customElements.define("tides-forecast", TidesForecast);
